import styled from "styled-components";
import Logo from '../Logo';
import NavBar from "../NavBar";
import IconesNavBar from "../IconesNavBar";



const HeaderContainer = styled.header`
    display: flex;
    flex-direction: column; 
    align-items: center;
    width: 100%;
 
`

function Header() {
    return (
        <HeaderContainer>
            <LogoWrapper>
                <Logo />
            </LogoWrapper>
            <NavBarWrapper>
                <NavBar />
                <IconesNavBar />
            </NavBarWrapper>
        </HeaderContainer>
    )
}




export default Header
